  `ID` varchar(32) NOT NULL COMMENT '唯一标识',
  `TEAM_NAME` varchar(32) NOT NULL COMMENT '团队名称',
  `TEAM_ICON` varchar(128) DEFAULT NULL COMMENT '战队图标',
  `TEAM_DEC` varchar(1024) DEFAULT NULL COMMENT '团队说明',
  `TEAM_STATUS` int(11) DEFAULT '1' COMMENT '团队状态: 1:有效 0：无效 默认1',
  `SORT_NUM` int(11) DEFAULT NULL COMMENT '排序',
  `CREATE_USER` varchar(32) DEFAULT NULL COMMENT '创建人',
  `CREATE_TIME` bigint(20) DEFAULT NULL COMMENT '创建时间',
  `UPDATE_USER` varchar(32) DEFAULT NULL COMMENT '修改人',
  `UPDATE_TIME` bigint(20) DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='战队管理';

