-- ----------------------------
-- Table structure for t_user_deposit_log
-- ----------------------------
DROP TABLE IF EXISTS `t_user_deposit_log`;
CREATE TABLE `t_user_deposit_log` (
  `ID` varchar(32) NOT NULL COMMENT '唯一标识',
  `USER_ID` varchar(32) DEFAULT NULL COMMENT '用户ID',
  `ORDER_NAME` varchar(128) DEFAULT NULL COMMENT '订单标题',
  `TYPE` varchar(4) DEFAULT NULL COMMENT '充值平台 1：支付宝，2：微信\r\n0：提现',
  `ORDER_NO` varchar(128) DEFAULT NULL COMMENT '交易订单编号',
  `UD_GOLD` bigint(20) DEFAULT NULL COMMENT '充值金额',
  `ORDER_TIME` bigint(20) DEFAULT NULL COMMENT '下单时间',
  `PAY_TIME` bigint(20) DEFAULT NULL COMMENT '支付时间',
  `IS_PAY_SUCCESS` varchar(4) DEFAULT NULL COMMENT '是否支付成功 1:是 0：否　，默认初始化为0\r\n提现 1：提现到账，0：提现申请，-1：提现退款',
  `REMARKS` varchar(512) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='充值记录';

-- ----------------------------
-- Records of t_user_deposit_log
-- ----------------------------

-- ----------------------------
-- Table structure for t_user_exchange_log
-- ----------------------------
DROP TABLE IF EXISTS `t_user_exchange_log`;
CREATE TABLE `t_user_exchange_log` (
  `ID` varchar(32) NOT NULL COMMENT '唯一标识',
  `STOCK_ID` varchar(32) DEFAULT NULL COMMENT '库存ID',
  `USER_ID` varchar(32) NOT NULL COMMENT '用户ID',
  `EXCHANGE_TIME` bigint(20) NOT NULL COMMENT '兑换时间',
  `EXCHANGE_GOLD` bigint(20) NOT NULL COMMENT '兑换金额',
  `EXCHANGE_STATUS` varchar(4) NOT NULL COMMENT '0：放到奖池（锁定），1：未领取, 2:已领取，3：出售中，4：已售出，-1：CD-KEY形式',
  `UE_ORDER_NO` varchar(64) NOT NULL COMMENT '数字订单编号',
  `TRACKER_NO` varchar(64) DEFAULT NULL COMMENT '物流单号',
  `CDK_CODE` varchar(16) DEFAULT NULL COMMENT 'cdk关联CODE',
  `RECEIVER_NAME` varchar(50) DEFAULT NULL COMMENT '收货人姓名',
  `RECEIVER_MOBILE` varchar(15) DEFAULT NULL COMMENT '手机号',
  `RECEIVER_ADDRESS` varchar(500) DEFAULT NULL COMMENT '详细地址',
  PRIMARY KEY (`ID`),
  UNIQUE KEY `UE_ORDER_NO` (`UE_ORDER_NO`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户兑换记录';

-- ----------------------------
-- Records of t_user_exchange_log
-- ----------------------------

