CREATE TABLE `t_user_friends` (
  `ID` varchar(32) NOT NULL COMMENT '唯一标识',
  `FRIEND_ID` varchar(32) NOT NULL COMMENT '好友ID',
  `USER_ID` varchar(32) NOT NULL COMMENT '用户ID',
  `CREATE_TIME` bigint(20) NOT NULL COMMENT '新增时间',
  `REWARD_GOLD_NUM` int(11) DEFAULT NULL COMMENT '奖励金币数量',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='推荐好友';

