-- ----------------------------
-- Table structure for t_user_increment
-- ----------------------------
DROP TABLE IF EXISTS `t_user_increment`;
CREATE TABLE `t_user_increment` (
  `ID` varchar(32) NOT NULL COMMENT '唯一标识',
  `USER_ID` varchar(32) NOT NULL COMMENT '用户ID',
  `JC_NUM` int(11) DEFAULT NULL COMMENT '竞猜量',
  `VICTORY_NUM` int(11) DEFAULT NULL COMMENT '胜利量',
  `VICTORY_RATE` varchar(8) DEFAULT NULL COMMENT '胜率',
  `UNREAD_NUM` int(11) DEFAULT NULL COMMENT '评论未读',
  `TOTAL_PROFIT_GOLD_NUM` bigint(20) DEFAULT NULL COMMENT '累计盈利数量',
  `SIGN_NUM` bigint(20) DEFAULT '0' COMMENT '签到总数',
  `CREATE_TIME` bigint(20) DEFAULT NULL COMMENT '创建时间',
  `UPDATE_TIME` bigint(20) DEFAULT NULL COMMENT '更新时间',
  `CREATE_OPERATOR_ID` varchar(32) DEFAULT NULL COMMENT '创建人',
  `UPDATE_OPERATOR_ID` varchar(32) DEFAULT NULL COMMENT '更新人',
  `IS_DELETED` int(11) DEFAULT NULL COMMENT '用户增量是否删除，用户删除时，该记录也相应删除，默认值0    0：未删除   1：已删除',
  `IS_INVOLVEMENT_IN_JC` int(11) DEFAULT NULL COMMENT '是否参与过竞猜',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户增量表';

-- ----------------------------
-- Records of t_user_increment
-- ----------------------------

-- ----------------------------
-- Table structure for t_user_jc
-- ----------------------------
DROP TABLE IF EXISTS `t_user_jc`;
CREATE TABLE `t_user_jc` (
  `ID` varchar(32) NOT NULL COMMENT '唯一标识',
  `USER_ID` varchar(32) NOT NULL COMMENT '用户ID',
  `GB_ID` varchar(32) DEFAULT NULL COMMENT '比赛对战ID',
  `PANKOU_ID` varchar(32) NOT NULL COMMENT '盘口ID',
  `JC_GOLD` bigint(20) DEFAULT NULL COMMENT '竞猜金币',
  `JC_TEAM_TYPE` varchar(4) DEFAULT NULL COMMENT '竞猜战队分类 1:主战队，2：客场战队',
  `GAME_RESULT` varchar(4) DEFAULT NULL COMMENT '比赛结果 默认2     0:输 1：赢  2 ：进行中 3：已取消',
  `VICTORY_GOLD_NUM` bigint(20) DEFAULT NULL COMMENT '用户赢得金币数量',
  `JC_TIME` bigint(20) DEFAULT NULL COMMENT '竞猜时间',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户竞猜';

-- ----------------------------
-- Records of t_user_jc
