DROP TABLE IF EXISTS `t_user_jc_share`;
CREATE TABLE `t_user_jc_share` (
  `ID` varchar(32) NOT NULL COMMENT '唯一标识',
  `GB_ID` varchar(32) NOT NULL COMMENT '比赛ID，gbId',
  `SHARE_USER_ID` varchar(32) DEFAULT NULL COMMENT '菠菜竞猜分享人id',
  `USER_MOBILE` varchar(12) DEFAULT NULL COMMENT '领取金币的手机号',
  `GOLD` bigint(20) DEFAULT NULL COMMENT '领取的金币数量',
  `CREATE_TIME` bigint(20) DEFAULT NULL COMMENT '领取金币的时间',
  `USER_DESC` varchar(150) DEFAULT NULL,
  `LUCKY` int(1) DEFAULT '0' COMMENT '1: 手气最佳；0：其他',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户竞猜分享';

