  `USER_ID` varchar(32) NOT NULL COMMENT '用户ID',
  `ADD_TIME` bigint(20) DEFAULT NULL COMMENT '签到日期',
  `GIVE_GOLD_NUM` bigint(20) DEFAULT NULL COMMENT '赠送金币量',
  PRIMARY KEY (`ID`)
