  `user_id` varchar(255) DEFAULT NULL COMMENT '用户名称',
  `task_id` varchar(32) DEFAULT NULL COMMENT '任务id',
  `complete_num` int(11) DEFAULT NULL COMMENT '任务完成次数',
  `create_time` bigint(20) DEFAULT NULL COMMENT '任务创建时间',
  `gold` int(11) DEFAULT NULL COMMENT '奖励金币',
  `completed_state` int(2) DEFAULT '0' COMMENT '任务完成的状态，0：未完成,1：已完成 ,2：已领取   默认0',
