DROP TABLE IF EXISTS `t_user_transaction_log`;
CREATE TABLE `t_user_transaction_log` (
  `ID` varchar(32) NOT NULL COMMENT '唯一标识',
  `USER_ID` varchar(32) NOT NULL COMMENT '用户ID',
  `UT_TYPE` varchar(4) NOT NULL COMMENT '交易类型 1:竞猜 2：充值 3:兑换 4:推荐好友奖励 5：用户签到 6：充值奖励 7:注册赠送 8:竞猜分享领取 9:提现',
  `DATA_ID` varchar(32) DEFAULT NULL COMMENT '业务ID',
  `GOLD_NUM` bigint(20) NOT NULL COMMENT '金币数量',
  `GOLD_TYPE` varchar(4) DEFAULT NULL COMMENT '货币类型，1金币 2G币',
  `UT_TIME` bigint(20) NOT NULL COMMENT '交易时间',
  `REMARKS` varchar(256) DEFAULT NULL COMMENT '备注(信息)',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户交易记录';

