INSERT INTO `t_sys_web_notice` VALUES ('6e13d26986eb43e4b03ec7d4c634b0dd', '如何竞猜', '<p style=\"white-space: normal;\">1、登录</p><p style=\"white-space: normal;\">2、保证自己账户里≥100G币</p><p style=\"white-space: normal;\">3、选择自己想要竞猜的卡片选项。</p><p><img src=\"/upload/ueditor/20170209/1486633421939038379.gif\" title=\"1486633421939038379.gif\" alt=\"1486633230417016821.gif\" width=\"805\" height=\"479\"/></p>', '1486633496141', '1', '4', '4', '3', null);
