INSERT INTO `t_sys_web_notice` VALUES ('851b938834dd484cb4a76919000ff134', '支付问题', '<p style=\"white-space: normal;\">付款遇到问题了?先看看是不是由于下面的原因。</p><p style=\"white-space: normal;\"><strong>要求开通网上银行?</strong></p><p style=\"white-space: normal;\">您可以联系对应银行开通网银，可以尝试使用支付宝、微信、财付通支付，或者下载美团APP在手机端完成支付。</p><p style=\"white-space: normal;\"><strong>所需支付金额超过了银行支付限额?</strong></p><p style=\"white-space: normal;\">建议先分若干次充值到G菠菜余额，或登录网上银行提高上限额度，即可轻松支付。</p><p style=\"white-space: normal;\"><strong>收不到银行的短信验证码?</strong></p><p style=\"white-space: normal;\">建议重新获取短信验证码，如果还是收不到短信，直接打各银行的客服电话获取短信验证码。</p><p style=\"white-space: normal;\"><strong>网银页面显示错误或者空白?</strong></p><p style=\"white-space: normal;\">建议刷新页面或更换到IE浏览器进行支付，您还可以选择支付宝、微信、财付通完成支付。</p><p style=\"white-space: normal;\"><strong>网上银行扣款后，G菠菜订单仍显示&quot;未付款&quot;怎么办?</strong></p><p style=\"white-space: normal;\">可能是由于银行的数据没有即时传输，请您不要担心，稍后刷新页面查看。如较长时间仍显示未付款，可先向银行或支付平台获取支付凭证(扣款订单号/第三方交易号)，联系G菠菜客服(<a href=\"mailto:kefu@gbocai.com\">kefu@gbocai.com</a>)为您解决。</p><p><br/></p>', '1486633355581', '1', '4', '3', '3', null);
