INSERT INTO `t_sys_web_notice` VALUES ('a292761dd0be49b7a04d723415e1e325', 'G菠菜注册&服务协议', '<p><span style=\"font-family: 等线; font-size: 14px;\"></span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">【前言】</span></span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">欢迎您使用</span>G菠菜的服务！</span></p><p><span style=\"font-family: 等线; font-size: 14px;\">为使用</span><span style=\"font-family: 等线; font-size: 14px;\">G菠菜的服务，您应当阅读并遵守《G菠菜服务协议》（以下简称“本协议”）。请您务必审慎阅读、充分理解各条款内容，特别是免除或者限制责任的条款。限制、免责条款可能以黑体加粗形式提示您注意。</span><br/></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">除非您已阅读并接受本协议所有条款，否则您无权使用</span>G菠菜提供的服务。您使用G菠菜的服务即视为您已阅读并同意上述协议的约束。</span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">如果您未满</span></span><span style=\";font-family:等线;font-size:14px\">18周岁，请在法定监护人的陪同下阅读本协议，并特别注意未成年人使用条款。</span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">一、</span></span><span style=\";font-family:等线;font-size:14px\">&nbsp;<span style=\"font-family:等线\">【协议的范围】</span></span></p><p><span style=\";font-family:等线;font-size:14px\">1.1 本协议是您与G菠菜之间关于用户使用G菠菜相关服务所订立的协议。“G菠菜”是指武汉沃达文化传媒有限公司及其相关服务可能存在的运营关联单位。“用户”是指使用G菠菜相关服务的使用人，在本协议中更多地称为“您”。</span></p><p><span style=\";font-family:等线;font-size:14px\">1.2 本协议项下的具体服务内容是指G菠菜根据实际情况，向用户提供的包括但不限于虚拟物品交易商城、赛事参与平台、新闻评论和广告等产品及服务（以下简称“本服务”）。</span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">二、</span></span><span style=\";font-family:等线;font-size:14px\">&nbsp;<span style=\"font-family:等线\">【帐号与密码安全】</span></span></p><p><span style=\";font-family:等线;font-size:14px\">2 </span></p><p><span style=\";font-family:等线;font-size:14px\">2.1 您在使用G菠菜的服务时可能需要注册一个帐号。G菠菜特别提醒您应妥善保管您的帐号和密码。当您使用完毕后，应安全退出。因您保管不善可能导致遭受盗号或密码失窃，责任由您自行承担。</span></p><p><span style=\";font-family:等线;font-size:14px\">2.2 您不应将自己的帐号、密码转让或出借予他人使用。如您发现自己的帐号遭他人非法使用，应立即通知G菠菜。并有权通知G菠菜采取措施暂停该账号的登录和使用。同时，您也应向G菠菜提供与被停用账号注册信息相一致的个人有效身份信息。G菠菜核实您所提供的个人有效身份信息与所注册的身份信息相一致的，应当及时采取措施暂停该账号的登录和使用。G菠菜违反前述约定，未及时采取措施暂停用户账号的登录和使用，因此而给您造成损失的，将有G菠菜承担。若您没有提供个人有效身份证件或者用户提供的个人有效身份信息与所注册的身份信</span><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">息不一致的，</span>G菠菜有权拒绝用户上述请求。此外，因黑客行为或您的保管疏忽导致帐号、密码遭他人非法使用，G菠菜不承担任何责任。</span></p><p><span style=\";font-family:等线;font-size:14px\">2.3 您注册的帐号自注册起90天内或连续365天，没有使用过该帐号（包括使用该帐号登录网站、充值），则G菠菜有权删除该帐号，包括但不限于注册信息、等级信息、物品信息等一切与该注册帐号相关的信息， </span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">三、</span></span><span style=\";font-family:等线;font-size:14px\">&nbsp;<span style=\"font-family:等线\">【用户个人信息保护】</span></span></p><p><span style=\";font-family:等线;font-size:14px\">3 </span></p><p><span style=\";font-family:等线;font-size:14px\">3.1 保护您的个人信息是G菠菜的一项基本原则。</span></p><p><span style=\";font-family:等线;font-size:14px\">3.2 您在注册帐号或使用本服务的过程中，可能需要填写一些必要的信息。若国家法律法规有特殊规定的，您需要填写真实的身份信息。若您填写的信息不完整，则无法使用本服务或在使用过程中受到限制。</span></p><p><span style=\";font-family:等线;font-size:14px\">3.3 一般情况下，您可随时浏览、修改自己提交的信息，但出于安全性和身份识别（如号码申诉服务）的考虑，您可能无法修改注册时提供的初始注册信息及其他验证信息。</span></p><p><span style=\";font-family:等线;font-size:14px\">3.4 G菠菜将运用各种安全技术和程序建立完善的管理制度来保护您的个人信息，以免遭受未经授权的访问、使用或披露。</span></p><p><span style=\";font-family:等线;font-size:14px\">3.5 未经您的同意，G菠菜不会向G菠菜以外的任何公司、组织和个人披露您的个人信息，但法律法规另有规定的除外。</span></p><p><span style=\";font-family:等线;font-size:14px\">3.6 G菠菜非常重视对未成年人个人信息的保护。若您是18周岁以下的未成年人，在使用G菠菜的服务前，应事先取得您家长或法定监护人（以下简称&quot;监护人&quot;）的书面同意。</span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">四、</span></span><span style=\";font-family:等线;font-size:14px\">&nbsp;<span style=\"font-family:等线\">【使用本服务的方式】</span></span></p><p><span style=\";font-family:等线;font-size:14px\">4 </span></p><p><span style=\";font-family:等线;font-size:14px\">4.1 您承诺以真实身份注册成为G菠菜的用户，并保证所提供的个人身份资料信息真实、完整、有效，依据法律规定和必备条款约定对所提供的信息承担相应的法律责任。您以真实身份注册成为G菠菜用户后，需要修改所提供的个人身份资料信息的，G菠菜应当及时、有效地为您提供该项服务。</span></p><p><span style=\";font-family:等线;font-size:14px\">4.2 G菠菜有权审查您注册时所提供的身份信息是否真实、有效，并应积极地采取技术与管理等合理措施保障您账号的安全、有效；您有义务妥善保管您的账号及密码，并正确、安全地使用您的账号及密码。任何一方未尽上述义务导致账号密码遗失、账号被盗等情形而给您和他人的民事权利造成损害的，应当承担由此产生的法律责任。</span></p><p><span style=\";font-family:等线;font-size:14px\">4.3 您对登录后所持账号产生的行为依法享有权利和承担责任</span></p><p><span style=\";font-family:等线;font-size:14px\">4.4 除非您与G菠菜另有约定，您同意本服务仅为您个人使用。</span></p><p><span style=\";font-family:等线;font-size:14px\">4.5 您应当通过G菠菜提供或认可的方式使用本服务。您依本协议条款所取得的权利不可转让。</span></p><p><span style=\";font-family:等线;font-size:14px\">4.6 您不得使用未经G菠菜授权的插件、外挂或第三方工具对本协议项下的服务进行干扰、破坏、修改或施加其他影响。</span></p><p><span style=\";font-family:等线;font-size:14px\">4.7 您通过服务对程序的使用受制于某些已经包含在规则中的行为准则。这些规则将在G菠菜官方网站公开并不定期更新，所有通过服务使用程序的用户必须遵守。您有义务知晓、了解并遵守这些行为规则。G菠菜保留权利决定何种行为违反游戏精神，并对该等行为采取其认为合适的相应的处理措施（包括但不限于警告、扣除虚拟货币、暂时或永久冻结账号、拒绝提供服务等）。G菠菜保留随时修改这些行为规则的权利。</span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">五、</span></span><span style=\";font-family:等线;font-size:14px\">&nbsp;<span style=\"font-family:等线\">【按现状提供服务】</span></span></p><p><span style=\";font-family:等线;font-size:14px\">5 </span></p><p><span style=\";font-family:等线;font-size:14px\">5.1 您理解并同意，G菠菜的服务是按照现有技术和条件所能达到的现状提供的。G菠菜会尽最大努力向您提供服务，确保服务的连贯性和安全性；但G菠菜不能随时预见和防范法律、技术以及其他风险，包括但不限于不可抗力、病毒、木马、黑客攻击、系统不稳定、第三方服务瑕疵、政府行为等原因可能导致的服务中断、数据丢失以及其他的损失和风险。</span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">六、</span></span><span style=\";font-family:等线;font-size:14px\">&nbsp;<span style=\"font-family:等线\">【自备设备】</span></span></p><p><span style=\";font-family:等线;font-size:14px\">6 </span></p><p><span style=\";font-family:等线;font-size:14px\">6.1 您应当理解，您使用G菠菜的服务需自行准备与相关服务有关的终端设备（如电脑、调制解调器等装置），并承担所需的费用（如电话费、上网费等费用）。</span></p><p><span style=\";font-family:等线;font-size:14px\">6.2 您理解并同意，您使用本服务时会耗用您的终端设备和带宽等资源。</span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">七、</span></span><span style=\";font-family:等线;font-size:14px\">&nbsp;<span style=\"font-family:等线\">【广告】</span></span></p><p><span style=\";font-family:等线;font-size:14px\">7 </span></p><p><span style=\";font-family:等线;font-size:14px\">7.1 您理解并同意，G菠菜可以在提供服务的过程中自行或由第三方广告商向您发送广告、推广或宣传信息（包括商业与非商业信息），其方式和范围可不经向您特别通知而变更。</span></p><p><span style=\";font-family:等线;font-size:14px\">7.2 G菠菜依照法律的规定对广告商履行相关义务，您应当自行判断广告信息的真实性并为自己的判断行为负责，除法律明确规定外，您因依该广告信息进行的交易或前述广告商提供的内容而遭受的损失或损害，G菠菜不承担责任。</span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">八、</span></span><span style=\";font-family:等线;font-size:14px\">&nbsp;<span style=\"font-family:等线\">【收费服务】</span></span></p><p><span style=\";font-family:等线;font-size:14px\">8 </span></p><p><span style=\";font-family:等线;font-size:14px\">8.1 G菠菜的部分服务是以收费方式提供的，如您使用收费服务，请遵守相关的协议。</span></p><p><span style=\";font-family:等线;font-size:14px\">8.2 G菠菜可能根据实际需要对收费服务的收费标准、方式进行修改和变更，G菠菜也可能会对部分免费服务开始收费。前述修改、变更或开始收费前，G菠菜将在相应服务页面进行通知或公告。如果您不同意上述修改、变更或付费内容，则应停止使用该服务。</span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">九、</span></span><span style=\";font-family:等线;font-size:14px\">&nbsp;<span style=\"font-family:等线\">【第三方提供的产品或服务】</span></span></p><p><span style=\";font-family:等线;font-size:14px\">9 </span></p><p><span style=\";font-family:等线;font-size:14px\">9.1 您在G菠菜平台上使用第三方提供的产品或服务时，除遵守本协议约定外，还应遵守第三方的用户协议。G菠菜和第三方对可能出现的纠纷在法律规定和约定的范围内各自承担责任。</span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">十、</span></span><span style=\";font-family:等线;font-size:14px\">&nbsp;<span style=\"font-family:等线\">【本服务中的软件】</span></span></p><p><span style=\";font-family:等线;font-size:14px\">10 </span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">您在使用本服务的过程中可能需要下载软件，对于这些软件，</span>G菠菜给予您一项个人的、不可转让及非排他性的许可。您仅可为访问或使用本服务的目的而使用这些软件。</span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">为了改善用户体验、保证服务的安全性及产品功能的一致性，</span>G菠菜可能会对软件进行更新。您应该将相关软件更新到最新版本，否则G菠菜并不保证其能正常使用。</span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">十一、</span></span><span style=\";font-family:等线;font-size:14px\">&nbsp;<span style=\"font-family:等线\">【知识产权声明】</span></span></p><p><span style=\";font-family:等线;font-size:14px\">G菠菜在本服务中提供的内容（包括但不限于网页、文字、图片、音频、视频、图表等）的知识产权归G菠菜所有，您在使用本服务中所产生的内容的知识产权归您或相关权利人所有。</span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">除另有特别声明外，</span>G菠菜提供本服务时所依托软件的著作权、专利权及其他知识产权均归G菠菜所有。</span></p><p><span style=\";font-family:等线;font-size:14px\">G菠菜在本服务中所使用的“</span><span style=\";font-family:等线;font-size:14px\">G币”、“积分”、“G菠菜”、“WODOTA”及WD logo形象等商业标识，其著作权或商标权归G菠菜所有。</span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">上述及其他任何本服务包含的内容的知识产权均受到法律保护，未经</span>G菠菜、您个人或相关权利人书面许可，任何人不得以任何形式进行使用或创造相关衍生作品。</span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">十二、</span></span><span style=\";font-family:等线;font-size:14px\">&nbsp;<span style=\"font-family:等线\">【用户违法行为】</span></span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">您在使用本服务时须遵守法律法规，不得利用本服务从事违法违规行为，包括但不限于：</span></span></p><p><span style=\";font-family:等线;font-size:14px\">( 1 ) 发布、传送、传播、储存危害国家安全统一、破坏社会稳定、违反公序良俗、侮辱、诽谤、淫秽、暴力以及任何违反国家法律法规的内容；</span></p><p><span style=\";font-family:等线;font-size:14px\">( 2 ) 发布、传送、传播、储存侵害他人知识产权、商业秘密等合法权利的内容；</span></p><p><span style=\";font-family:等线;font-size:14px\">( 3 ) 恶意虚构事实、隐瞒真相以误导、欺骗他人；</span></p><p><span style=\";font-family:等线;font-size:14px\">( 4 ) 发布、传送、传播广告信息及垃圾信息；</span></p><p><span style=\";font-family:等线;font-size:14px\">( 5 ) 其他法律法规禁止的行为。</span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">如果您违反了本条约定，相关国家机关或机构可能会对您提起诉讼、罚款或采取其他制裁措施，并要求</span>G菠菜给予协助。造成损害的，您应依法予以赔偿，G菠菜不承担任何责任。</span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">如果</span>G菠菜发现或收到他人举报您发布的信息违反本条约定，G菠菜有权进行独立判断并采取技术手段予以删