></p><p><span style=\";font-family:等线;font-size:14px\">G菠菜有权在必要时修改本协议条款。您可以在相关服务页面查阅最新版本的协议条款。</span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">本协议条款变更后，如果您继续使用</span>G菠菜提供的软件或服务，即视为您已接受修改后的协议。如果您不接受修改后的协议，应当停止使用G菠菜提供的软件或服务。</span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">十七、</span></span><span style=\";font-family:等线;font-size:14px\">&nbsp;<span style=\"font-family:等线\">【服务的变更、中断或终止】</span></span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">鉴于网络服务的特殊性，您同意</span>G菠菜有权随时变更、中断或终止部分或全部的网络服务（包括收费网络服务）。如变更、中断或终止的网络服务属于免费网络服务，G菠菜无需通知您，也无需对您或任何第三方承担任何责任；如变更、中断或终止的网络服务属于收费网络服务，G菠菜应当在变更、中断或终止之前事先通知您，并应向您提供等值的替代性的收费网络服务，如您不愿意接受替代性的收费网络服务，就您已经向G菠菜支付的服务费，G菠菜应当按照您实际使用相应收费网络服务的情况扣除相应服务费之后将剩余的服务费退还给您。</span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">您理解并同意，</span>G菠菜需要定期或不定期地对提供网络服务的平台（如互联网网站、移动网络等）或相关的设备进行检修或者维护，如因此类情况而造成收费网络服务在合理时间内的中断，G菠菜无需为此承担任何责任，但G菠菜将尽可能事先进行通告。</span></p><p><span style=\";font-family:等线;font-size:14px\">G菠菜服务（尤指但不仅指威佩虚拟物品交易平台及附带相关软件）的各个新版本，G菠菜可以自行决定是否保留为G菠菜服务增加附加特点和功能，或者提供程序编程之修补、更新和升级的权利。G菠菜无需向您发出通知即可自行决定修改、停止或暂停您对任何版本G菠菜服务的使用，和</span><span style=\";font-family:等线;font-size:14px\">/或禁用您已经使用或安装的G菠菜服务，以便对相关技术进行检修、改良和/或升级，或者出于其他合理原因；对于由发行和/或不发行G菠菜服务的新版本而导致的直接或间接损害，威佩将不承担任何赔偿责任。</span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">如发生下列任何一种情形，</span>G菠菜有权不经通知而中断或终止向您提供的服务：</span></p><p><span style=\";font-family:等线;font-size:14px\">( 1 ) 根据法律规定您应提交真实信息，而您提供的个人资料不真实、或与注册时信息不一致又未能提供合理证明；</span></p><p><span style=\";font-family:等线;font-size:14px\">( 2 ) 您违反相关法律法规或本协议的约定；</span></p><p><span style=\";font-family:等线;font-size:14px\">( 3 ) 按照法律规定或主管部门的要求；</span></p><p><span style=\";font-family:等线;font-size:14px\">( 4 ) 出于安全的原因或其他必要的情形。</span></p><p><span style=\";font-family:等线;font-size:14px\">G菠菜有权按本协议</span><span style=\";font-family:等线;font-size:14px\">8.2条的约定进行收费。若您未按时足额付费，G菠菜有权中断、中止或终止提供服务。</span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">您有责任自行备份存储在本服务中的数据。如果您的服务被终止，</span>G菠菜可以从服务器上永久地删除您的数据。服务终止后，G菠菜没有义务向您返还数据。</span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">十八、</span></span><span style=\";font-family:等线;font-size:14px\">&nbsp;<span style=\"font-family:等线\">【管辖与法律适用】</span></span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">本协议签订地为中华人民共和国湖北省武汉市东湖开发区。</span></span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">本协议的成立、生效、履行、解释及纠纷解决，适用中华人民共和国大陆地区法律（不包括冲突法）。</span></span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">若您和</span>G菠菜之间发生任何纠纷或争议，首先应友好协商解决；协商不成的，您同意将纠纷或争议提交本协议签订地有管辖权的人民法院管辖。</span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">本协议所有条款的标题仅为阅读方便，本身并无实际涵义，不能作为本协议涵义解释的依据。</span></span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">本协议条款无论因何种原因部分无效或不可执行，其余条款仍有效，对双方具有约束力。</span></span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">十九、</span></span><span style=\";font-family:等线;font-size:14px\">&nbsp;<span style=\"font-family:等线\">【未成年人使用条款】</span></span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">若用户未满</span></span><span style=\";font-family:等线;font-size:14px\">18周岁，则为未成年人，应在监护人监护、指导下阅读本协议和使用本服务。</span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">未成年人用户涉世未深，容易被网络虚象迷惑，且好奇心强，遇事缺乏随机应变的处理能力，很容易被别有用心的人利用而又缺乏自我保护能力。因此，未成年人用户在使用本服务时应注意以下事项，提高安全意识，加强自我保护：</span></span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">认清网络世界与现实世界的区别，避免沉迷于网络，影响日常的学习生活；</span></span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">填写个人资料时，加强个人保护意识，以免不良分子对个人生活造成骚扰；</span></span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">在监护人或老师的指导下，学习正确使用网络；</span></span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">避免陌生网友随意会面或参与联谊活动，以免不法分子有机可乘，危及自身安全。</span></span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">监护人、学校均应对未成年人使用本服务时多做引导。特别是家长应关心子女的成长，注意与子女的沟通，指导子女上网应该注意的安全问题，防患于未然。</span></span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">二十、</span></span><span style=\";font-family:等线;font-size:14px\">&nbsp;<span style=\"font-family:等线\">【其他】</span></span></p><p><span style=\";font-family:等线;font-size:14px\"><span style=\"font-family:等线\">如果您对本协议或本服务有意见或建议，可与</span>G菠菜客户服务部门联系（</span><span style=\";font-family:等线;font-size:14px\">kefu@</span><span style=\";font-family:等线;font-size:14px\">gbocai</span><span style=\";font-family:等线;font-size:14px\">.com），我们会给予您必要的帮助。</span></p><p><br/></p>', '1482739497181', '1', '5', '3', '2', 'agreement');
